import './StartButton.css'

function StartButton(props) {

	const [state, dispatch] = useContext(Context);
    console.warn(state.nRepos)
    if (!state.isGameOver) {
        console.warn('Game not over!')
        return
    }

    return (
        <button
        id='start-button'
        onClick={() => dispatch(
            {type: 'START_NEW_GAME'}
        )}
        >Start new game </button>
    )
}
